data:
  definition: element of a wiring system above or in the ground or floor, open, ventilated
    or closed, and having dimensions which do not permit the entry of persons but
    allow access to the conduits and/or cables throughout their length during and
    after installation
  examples: []
  notes:
  - A cable channel may or may not form part of the building construction.
